                                                                "type": "textnode",
                                                                "content": " If for any reason the operation or administration of this Sweepstakes is impaired or incapable of running as planned for any reason, including but not limited to (i) tampering, unauthorized intervention, (ii) fraud, (iii) technical failures or (iv) any other causes beyond the control of the Sponsor which corrupt or affect the administration, security, fairness, integrity or proper conduct of this Sweepstakes, the Sponsor reserves the right at its sole discretion, to disqualify any individual who tampers with the entry process, and to cancel, terminate, modify or suspend the Sweepstakes in whole or in part, at any time, without notice and award the Prizes to non-suspect eligible winning entries as of, or after (if applicable) this cancellation, termination, modification or suspension date, or in any manner that is fair and equitable and best conforms to the spirit of these Official Rules. Sponsor reserves the right, at its sole discretion, to disqualify any individual deemed to be tampering or attempting to tamper with the entry process or the operation of the Sweepstakes; or acting in violation of these Official Rules or in an unsportsmanlike or disruptive manner. Failure by the Sponsor to enforce any provision of these Official Rules shall not constitute a waiver of that provision."
