                                                                "type": "textnode",
                                                                "content": "All issues and questions concerning the construction, validity, interpretation and enforceability of these Official Rules or the rights and obligations of Entrants, Administrator, and Sponsor in connection with the Sweepstakes shall be governed by and construed in accordance with the laws of the State of New York, without giving effect to any choice of law or conflict of law rules or provisions that would cause the application of any other states, provinces, or jurisdictions laws. By participating in the Sweepstakes, Entrant agrees that: (i) any and all disputes, claims, and causes of action arising out of or in connection with the Sweepstakes, shall be resolved individually without resort to any form of class action; (ii) any judicial proceeding shall take place in a court within the State of New York; (iii) any and all claims, judgments , and awards shall be limited to actual out-of-pocket costs incurred, including costs associated with entering this Sweepstakes, but in no event will attorney fees be awarded or recoverable; (iv) under no circumstances will Entrant be permitted to obtain awards for, and Entrant hereby waives all rights to seek, punitive, incidental, exemplary, consequential, special damages, lost profits, other damages, and/or any rights to have damages multiplied or otherwise increased; and (v) Entrants remedies are limited to a claim for money damages (if any) and he/she waives any right to seek injunctive or equitable relief."
